  //       if(element.wunit=="lb")
  //       {
  //         total.totalWghtLb +=element.wght;
  //         total.totalWghtKg +=element.wght /2.20462
  //       }
  //       return total;
  //     },

  //   );
  //   return totalkgs.totalWghtKg;
  // }


  
  //navigate to thank you page
  goToThankYouPage() 
  {
    this.router.navigate(['/success']);
  }
}
